    function _getDustCanvas(uint256 tokenId, uint256 n)
        internal
        view
        returns (string[16] memory)
    {
        string[16] memory canvas;
        uint256 rand = SpellsStorage.tokenSeed(tokenId);
        if (n > 33) {
            n = 33;
        }
        uint256 i;
        uint256 j;
        SpellsRendererStorage.Storage storage es = SpellsRendererStorage
            .getStorage();
        uint256[256] memory _chars;
        for (i = 0; i < n; i++) {
            if (_chars[rand % 256] <= 0) {
                _chars[rand % 256] = (rand % es.dusts.length) + 1;
            } else {
                i--;
            }
            rand = rand.div(i + 3);
        }
        uint256 charidx;
        for (i = 0; i < 16; i++) {
            for (j = 0; j < 16; j++) {
                charidx = _chars[i * 16 + j];
                if (charidx > 0) {
                    canvas[i] = string(
                        abi.encodePacked(canvas[i], es.dusts[charidx - 1])
                    );
                    rand += (i * j + j + 1);
                } else {
                    canvas[i] = string(abi.encodePacked(canvas[i], "\u00A0"));
                }
            }
        }
        return canvas;
    }

    function _getSpell(uint256 tokenId)
        internal
        view
        returns (
            string memory title,
            string memory sigil,
            string[3] memory chant
        )
    {
        SpellsRendererStorage.Storage storage es = SpellsRendererStorage
            .getStorage();
        SpellsCastStorage.Storage storage spellsStorage = SpellsCastStorage
            .getStorage();
        uint256 rand = SpellsStorage.tokenSeed(tokenId);
        uint256 _kind = rand % 3;
        uint256 greatness = rand % 21;
        uint256 faction = spellsStorage.factions[tokenId];
        if (_kind < 1) {
            title = string(
                abi.encodePacked(
                    es.element[rand % es.element.length],
                    " ",
                    es.spell[rand % es.spell.length]
                )
            );
        } else {
            title = string(
                abi.encodePacked(
                    es.kind[rand % es.kind.length],
                    " ",
                    es.spell[rand % es.spell.length]
                )
            );
        }

        if (greatness > 14 && greatness % 3 != 0) {
            title = string(
                abi.encodePacked(
                    es.prefixes[rand % es.prefixes.length],
                    " ",
                    title
                )
            );
        }

        // 16, 18, 20
        if (greatness >= 16 && greatness % 2 == 0) {
            title = string(
                abi.encodePacked(
                    title,
                    " ",
                    es.suffixes[rand % es.suffixes.length]
                )
            );
        }

        // 19, 20
        sigil = es.sigils[rand % es.sigils.length];
        if (faction > 0) {
            sigil = es.gateSigils[faction - 1];
        }
        if (greatness >= 18 && rand % 2 == 0) {
            rand = rand.div(3);
            if (faction == 0) {
                title = string(
                    abi.encodePacked(
                        es.demigods[rand % es.demigods.length],
                        "'s ",
                        title
                    )
                );
            } else {
                title = string(
                    abi.encodePacked(
                        es.gods[faction - 1][
                            rand % es.gods[faction - 1].length
                        ],
                        "'s ",
                        title
                    )
                );
            }
            if (greatness == 20) {
                sigil = es.legendarySigils[faction][1];
            } else {
                sigil = es.legendarySigils[faction][0];
            }
        }

        rand = random(title);
        uint256 n = 0;
        if (greatness > 16) {
            n = 5;
        }
        n = (rand % 7) + 4 + n;
        uint256 i = 0;
        uint256 offset = 0;
        for (i = 0; i < n; i++) {
            rand = rand.div(i + 1);
            offset = i.div(5);
            if (bytes(chant[offset]).length == 0) {
                chant[offset] = es.words[rand % es.words.length];
            } else {
                chant[offset] = string(
                    abi.encodePacked(
                        chant[offset],
                        " ",
                        es.words[rand % es.words.length]
                    )
                );
            }
        }
        return (title, sigil, chant);
    }

